import { FETCH_RENTALS } from "./types";

const rentals = [
  {
    id: 1,
    title: "testing"
  }
];

export const fetchRentals = async dispatch => {
  //   return {
  //     type: FETCH_RENTALS
  //   };
  dispatch({ type: FETCH_RENTALS, rentals });
};
